import React from 'react'

const Header = () => {
    const styleHeader={
        color:'blue',
        backgroundColor:'white',
        padding:'10px',
        textAlign:'center',
        fontSize:'20px',
        fontFamily:'Arial',
        fontWeight
        :'bold'}
    function NameChange(){
        const names=["Money"];
        const poss=Math.floor(Math.random());
        return (names[poss]);
        } 
    return(
      <p style={styleHeader}>
      <h1>To do List</h1>
      <p>Lets Earn{NameChange()} </p>
      </p> 
    )
}

export default Header
